import React from "react";

export const NavBar = () => {
  return (
    <ul class="nav nav-underline">
      <li class="nav-item">
        <a class="nav-link" aria-current="page" href="#">
          STAR WARS
        </a>
      </li>
      <li class="nav-item ms-auto">
        <a class="nav-link" href="#">
          Link
        </a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">
          Link
        </a>
      </li>
    </ul>
  );
};
